import styles from './Friends.module.css'

import greenDot from '../../image/online.png'
import redDot from '../../image/offline.png'
import defaultImg from '../../image/defaultImg.jpg'


const Avatar = (url) => (
    <img className={styles.avatar} src={url} alt="pic" width="70px" />
);

const Friend = ({ friends }) => {
    return (
        friends.map(({ id, isOnline, avatar, name }) => {
            console.log(avatar);
            return (
                <li className={styles.item} key={id}>
                    <span className={styles.status}>
                        {isOnline
                            ? <img src={greenDot} width="15px" alt="online pic" />
                            : <img src={redDot} width="15px" alt="offline pic" />}</span>
                    <Avatar url={avatar} />
                    <p className={styles.name}>{!!name ? name : 'Your friend'}</p>
                </li>)
        })
    );
}


Avatar.defaultProps = {
    url: defaultImg
};

Friend.defaultProps = {
    friends: [],
    avatar: defaultImg,
};

export default Friend;
